{"id": "msg_01JXdXDgkJavWvFoCCQgFsdL", "content": [{"citations": null, "text": "El 4 de junio de 1989, en la Plaza de Tiananmén de Pekín, China, el gobierno chino reprimió violentamente una protesta pacífica de estudiantes y trabajadores que pedían reformas democráticas. Las tropas del Ejército Popular de Liberación abrieron fuego contra los manifestantes, causando un número indeterminado de muertos y heridos. 

Las protestas, conocidas como el Movimiento del 4 de Junio o la Masacre de Tiananmén, habían comenzado semanas antes con manifestaciones pacíficas que exigían mayor libertad política, transparencia gubernamental y el fin de la corrupción. A pesar de ser inicialmente pacíficas, el gobierno decidió usar la fuerza militar para sofocar las protestas.

